import React from "react";
import styles from "./ProjectInfo.module.scss";
import { Link } from 'react-router-dom';
import gitgub from '../../../shared/assets/icons/github.png'

const ProjectInfo = ({ data }) => {
  return (
    <div className={styles.info}>
      <h3 className={styles.info_title}>{data?.name}</h3>
      <p className={styles.info_desk}>{data?.descripton}</p>
      <a href={data?.reference} target="_blank" class={styles.info_btn}>Посмотреть проект</a>
      <a href={data?.reference} target="_blank" >
        <img src={gitgub} alt="" />
      </a>
    </div>
  );
};

export default ProjectInfo;
